import React, { Component } from 'react';
import { Grid } from 'semantic-ui-react';
import logo from '../img/background.png';

export default class Histoire extends Component {
  render() {
    return (
      <div className="bodyDesktop">
        <Grid textAlign="center">
          <Grid.Column widescreen={12}>
            {/* <img id="BigLOGO" src={logo} alt="" /> */}
          </Grid.Column>
        </Grid>
      </div>
    );
  }
}
